#[test]
fn test_type_app_js_format_1_d22bb377() {
    let pretty_printer = PrettyPrinterBuilder::default()
        .parser("js")
        .print_width(80)
        .build()
        .unwrap();
    let formatted = pretty_printer . format ("/**\n * @flow\n */\n\nclass LocalClass<T> {}\n\nvar a: LocalClass<number> | number = 123;\n\n// Iterator is defined in a lib file, so the speculative algorithm for the\n// union type would incorrectly succeed for Iterator<number>. Only later during\n// the merge would we fine the error, but it would be too late. The diff that\n// introduces this test fixes this such that the speculative algorithm is\n// correctly delayed upon encountering a non-concrete TypeAppT\nvar b: Iterator<number> | number = 123;") ;
    assert!(formatted.is_ok());
    let formatted = formatted.unwrap();
    assert_eq ! (formatted , "/**\n * @flow\n */\n\nclass LocalClass<T> {}\n\nvar a: LocalClass<number> | number = 123;\n\n// Iterator is defined in a lib file, so the speculative algorithm for the\n// union type would incorrectly succeed for Iterator<number>. Only later during\n// the merge would we fine the error, but it would be too late. The diff that\n// introduces this test fixes this such that the speculative algorithm is\n// correctly delayed upon encountering a non-concrete TypeAppT\nvar b: Iterator<number> | number = 123;");
}
#[test]
fn test_union_js_format_1_ae1124aa() {
    let pretty_printer = PrettyPrinterBuilder::default()
        .parser("js")
        .print_width(80)
        .build()
        .unwrap();
    let formatted = pretty_printer . format ("function bar(x: Document | string): void { }\nbar(0);\n\nclass C { }\nclass D { }\nfunction CD(b) {\n  var E = b? C: D;\n  var c:C = new E(); // error, since E could be D, and D is not a subtype of C\n  function qux(e: E) { } // this annotation is an error: is it C, or is it D?\n  function qux2(e: C | D) { } // OK\n  qux2(new C);\n}\n\ndeclare class F {\n    foo(x: number):void;\n    foo(x: string):void;\n}\nfunction corge(b) {\n    var x = b ? \"\" : 0;\n    new F().foo(x);\n}") ;
    assert!(formatted.is_ok());
    let formatted = formatted.unwrap();
    assert_eq ! (formatted , "function bar(x: Document | string): void {}\nbar(0);\n\nclass C {}\nclass D {}\nfunction CD(b) {\n  var E = b ? C : D;\n  var c: C = new E(); // error, since E could be D, and D is not a subtype of C\n  function qux(e: E) {} // this annotation is an error: is it C, or is it D?\n  function qux2(e: C | D) {} // OK\n  qux2(new C());\n}\n\ndeclare class F {\n  foo(x: number): void;\n  foo(x: string): void;\n}\nfunction corge(b) {\n  var x = b ? \"\" : 0;\n  new F().foo(x);\n}");
}
